  // Function to write a pixel to the VGA buffer
    void write_pixel_to_vga(int x, int y, uint16_t color) {
        volatile short int *pixel_addr = (volatile short int *)(pixel_buffer_start + (y << 10) + (x << 1));
        *pixel_addr = color;
    }
  
  void clear_screen() {
    for (int x = 0; x < 320; x++) {
      for (int y = 0; y < 240; y++) {
        plot_pixel(x, y, 0x0);  // pass black as colour to draw with
      }
    }
  }
  
  void draw_box(int x, int y, int width, int height, short int colour) {
    int rightEdge = x + width;
    int lowerEdge = y + height;
    for (int j = y; j < lowerEdge; j++) draw_line(x, j, rightEdge, j, colour);
  }
  
  void draw_line(int x0, int y0, int x1, int y1, int colourHex) {
    bool isSteep = abs(y1 - y0) > abs(x1 - x0);
    if (isSteep) {
      swap(&x0, &y0);
      swap(&x1, &y1);
    }
  
    if (x0 > x1) {
      swap(&x0, &x1);
      swap(&y0, &y1);
    }
  
    int deltax = x1 - x0;
    int deltay = abs(y1 - y0);
    int error = -(deltax / 2);
    int y = y0;
    int y_step;
  
    if (y0 < y1) {
      y_step = 1;
  
    } else {
      y_step = -1;
    }
  
    for (int x = x0; x <= x1; x++) {
      if (isSteep) {
        plot_pixel(y, x, colourHex);
      } else {
        plot_pixel(x, y, colourHex);
        error = error + deltay;
      }
      if (error > 0) {
        y = y + y_step;
        error = error - deltax;
      }
    }
  }
  
