                int sw_value = (*SW_ptr >> 1) & 0x3FF;  // Original mask preserved
                
                // Iterate through each switch/LED pair (0-8 corresponds to switches 1-9)
                for (int i = 0; i < 9; i++) {
                    // Check if current switch is ON
                    int switch_state = (sw_value >> i) & 0x1;
                    SW_on_off[i] = switch_state;  // Update switch state array
                    
                    // Set LED only if both switch is ON and current is non-zero
                }
